import './App.css';
import React, { Fragment } from 'react';
import { Button, TextField, Icon, Grid } from '@material-ui/core';

function RowName() {
  return (
    <div className="rowName">
      <label>Name</label>
      <TextField className="inputName" id="outlined-basic" label="Name" variant="outlined" />
    </div>
  );
}

function RowDate() {
  return (
    <div className="rowDate">
      <label>Date</label>
      <TextField
        className="inputDate"
        id="date"
        label="Register Date"
        type="date"
        defaultValue="2017-05-24"
        InputLabelProps={{
          shrink: true,
        }}
      />
    </div>
  );
}

function SendBtn() {
  return (
    <div className="sendBtn">
      <Button
        variant="contained"
        color="primary"
        endIcon={<Icon>send</Icon>}
      >
        Send
    </Button>
    </div>
  );
}

function RowContext() {
  return (
    <div className="rowContent">
      <label>Context</label>
      <TextField
        className="inputContext"
        id="outlined-basic"
        label="Context"
        variant="outlined"
        fullWidth="true"
        multiline
      />
    </div>
  );
}

function App() {
  return (
    <Fragment>
      <div className="mainGrid">
        <div className="inputForm">
          <form>
            <Grid
              container
              spacing={3}    /* item과의 거리 spacing 숫자 * 8px */
            >
              <Grid item xs>
                <RowName />
              </Grid>
              <Grid item xs>
                <RowDate />
              </Grid>
            </Grid>
            <Grid container spacing={3}>
              <Grid item xs>
                <RowContext />
              </Grid>
            </Grid>
          </form>
        </div>
      </div>
    </Fragment>
  );
}

export default App;
